import React from "react";
import store from "../store";

let employees = [
  {
    firstName: "John",
    age: 27,
  },

  {
    firstName: "Ana",
    age: 25,
  },

  {
    firstName: "Zion",
    age: 30,
  },
];

const employeesSort = employees.sort((a, b) => {
  return a.age - b.age;
});

console.log(employees);
console.log(employeesSort);

const clientData = store.getState().clientReducer.sort;
const clientDataSort = clientData.sort((a, b) => {
  return a.first_name - b.first_name;
});

const clientItems = clientDataSort.map((item) => (
  <li key={item.id}>{item.first_name}</li>
));

export default function Clients() {
  return <div>{clientItems}</div>;
}
